<H1><A NAME="rc2123"></A><SUP></SUP>Resource Compiler Error RC2123</H1>

<P class=dt><B>END expected in menu</B></P>

<P>The <B>END</B> keyword must come at the end of a <B>MENU</B> statement. Make sure you do not have any open quotation marks or a mismatched pair of <B>BEGIN</B> and <B>END</B> statements.</P>
